					log.Errorf("Trigger Gns Delete: %s", hashedName)
					err = group.DeleteGnsByName(newCtx, hashedName)
					if err != nil {
						log.Errorf("Error occur while deleting Gns: %s", hashedName)
						return err
					}
					log.Errorf("Gns Deleted: %s", hashedName)
